import React from 'react';
import {Card,Button} from 'react-bootstrap';
import {Form,FormFeedback,FormGroup,Col,Label,Input,} from 'reactstrap';
import './AYA.css';

class AYA extends React.Component{

 constructor(props){
     super(props);
 }

 render(){
 return(
     <div>
    <Card  border="dark" className="CardBody">
       <Card.Img variant="top" src="assets/images/AYA.png" />
       <Card.Body>
              <Card.Title classname="Cardtext">Analysis Your Accuracy !</Card.Title>
       <Card.Text>
           <div>
           <Form>
             <FormGroup>
                <Label htmlFor="firstname" md={2}>First Name</Label>
                                <Input typr="text" id="firstname"  name="firstname" placeholder="First Name" 
                                />
                                <FormFeedback></FormFeedback>
                       </FormGroup>
                       <FormGroup row>
                           <Label htmlFor="lastname" md={2}>Last Name</Label>
                            <Col>
                                <Input typr="text" id="lastname"  name="lastname" placeholder="Last Name" 
                                />
                                <FormFeedback></FormFeedback>
                            </Col>
                       </FormGroup>
         </Form>
           </div>
      </Card.Text>
    <Button variant="primary">Go somewhere</Button>
  </Card.Body>
</Card>

     </div>

 )
 }
}

export default AYA;
